import SearchBar from '../SearchBar/SearchBar';

export default function Nav(props) {
    const { onSearch } = props;

    return (
        <div>
            <SearchBar onSearch = {onSearch} />
            <Link to="/home">
                <button>Home</button>
            </Link>

            {/* <Link to="/favorite">
                <button>Favorites</button>
            </Link> */}

            <Link to="/about">
                <button>About</button>
            </Link>
        </div>
    );
}
